// React Router
import { createBrowserRouter, } from "react-router-dom";
import Login from './pages/login';
import Market from './pages/market';
import ResetPass from './pages/resetpass'
import Home from '.pa'

const router = createBrowserRouter([
    { 
        path: "/", 
        element: <Login /> 
    },

    { 
        path: "/market", 
        element: <Market /> 
    },

    { 
        path: "/reset", 
        element: <ResetPass /> 
    },
])

export default router
